import React from "react";
import "./App.css";
import Aux from "../src/com/fplan/hoc/Aux";
import HeaderImages from "../src/com/fplan/components/images/header/HeaderImages";
import GenNavBar from "../src/com/fplan/components/generalhome/GenNavBar";
import SignIn from "../src/com/fplan/components/signing/SignIn";
import { BrowserRouter, Route, Switch } from "react-router-dom";

const App = (props) => {
  let routes = (
    <BrowserRouter>
      <Switch>
        <Route path="/signin" component={SignIn}></Route>
        <Route path="/" component={GenNavBar}></Route>
      </Switch>
    </BrowserRouter>
  );

  return (
    <Aux>
      <HeaderImages></HeaderImages>
      <div className="App">{routes}</div>
    </Aux>
  );
};

export default App;
